import React from 'react'
import ref from '../../firebase'


export default function MainPage() {
    console.log("Main page");
    const collection = ref().collection("fillings")
    return (
        <div>
            <h1>{collection.title}</h1>
            <p>{collection.desc}</p>
        </div>
    )
}
